import classes from "./Header.module.css"

const Header = () =>
{
    const TravelTo = () =>
    {
        window.location.href = "http://localhost:3000/home"
    }
    return(
        <div>
            <button onClick={TravelTo} className={classes.textInHeader}>EduSchedule</button>
        </div>
    )
}

export default Header;
